import React from "react";
import { Link } from 'react-router-dom';
import News from "./News";

function Home() {
  return (
    <div className="home-content">
        <div className="cover">
            <h1>It's Time To Work.</h1>
            <Link to="/login"><button className="btn btn-primary">Get Started</button></Link>
        </div>
        <News/>
    </div>
  );
}

export default Home;
